import { Box } from "@mui/material";

const QuizItem = (item) => {
  return (
    <Box className="itemContainer">
      <Box>{item.title}</Box>
      <Box>Score: {item.passingScore}</Box>
    </Box>
  );
};
export default QuizItem;
